create table pcr_credit_acc_special_list
(
    id                   varchar(64)    not null comment '主键ID',
    order_id             varchar(64)    null comment '订单流水号',
    serial_id            varchar(64)    null comment '数据流水号',
    etl_id               varchar(64)    null comment '清洗流水号',
    report_id            varchar(32)    null comment '报告编号',
    special_code         varchar(60)    null comment '特殊交易类型',
    special_credatetime  datetime       null comment '特殊交易发生日期',
    due_datetime_mm_num  int            null comment '到期日期变更月数',
    special_amount       decimal(12, 2) null comment '特殊交易发生金额',
    special_list         varchar(600)   null comment '特殊交易明细记录',
    fk_id                varchar(32)    null comment '外键FK_ID',
    creditacc_account_no varchar(30)    null comment '账户编号',
    create_time          datetime       not null comment '入库时间',
    primary key (id, create_time)
)
    comment 'D_01_05_01-特殊交易信息段_详情' engine = InnoDB;

create index idx_etl_report_account_no
    on pcr_credit_acc_special_list (etl_id, report_id, creditacc_account_no);

